var titleimg = 'data:image/png;base64,';
var downimg = 'data:image/png;base64,';
var html = '<div id="p-dialog">' +
	'<div><img src="'+titleimg+'"></div>' +
	'<div id="p-content">'+
		'<div>正在导出<span id="p-total">1</span>/<span id="p-last"></span>页</div>'+
		'<div><img src="'+downimg+'" /></div>'+
		'<div><a id="p-save">保存 CSV 文件</a> </div>'+
		'<div><a href="javascript:" id="p-close">取 消</a></div>'+
	'</div>'+
'</div>';

var dialog = $(html);
$('body').append(dialog);

/**
 * 将二维数组格式化为 CSV 文件
 */
function formatCSVFile(arr){
	var fields = ['关键字', '百度链接', '关键词包含', '排名', '搜索量', '(PC端)', '(移动)', '收录量', '网页标题', '网页链接'];
	arr.unshift(fields);
	var str = [];
	for(var i=0;i<arr.length;i++){
		if(!arr[i]) continue;
		for(var j=0; j<arr[i].length; j++){
			if(arr[i][j].indexOf('"')>-1) {
				arr[i][j] = '"'+arr[i][j]+'"';
			}
		}
		str.push(arr[i].join(','));
	}
	return "\ufeff"+str.join("\n");
}

function setDownloadURL(file){
	var url = 'data:text/csv;base64,' + Base64.encode(formatCSVFile(file));
	return $('#p-save').attr('href', url)
		.attr('download', (new Date()).toLocaleString().split(' ')[0]+'.csv');
}

var cancle = function(){
	dialog.hide();
};
$('#p-close', dialog).click(cancle);


//解析器：网页table to CSV data
var parser = function(tr){
	var j=0;
	var values = [];
	var pushText = function(){
		values.push($.trim($(this).text()));
	};
	var pushLink = function(){
		values.push($('a',this).attr('href'));
	};
	$('td', tr).each(function(){	
		if($(this).attr('rowspan')){
			return;
		}
		j++;
		if(j==1){ //第一列
			values.push($('a', this).text()); //关键词
			values.push($('a',this).attr('href'));//链接
			var tishi = ''; //关键词包含
			if($('.tishi b',this).length>0){
				tishi = $('.tishi b',this).html();
			}
			values.push(tishi);
		} else if(j < 7 && j > 1){ //第N列
			pushText.call(this);
		} else { //带链接 //最后一列
			pushText.call(this);
			pushLink.call(this);
		}
	});
	return values;
};

/* 解析页面 */
function parsePage(doc){
	var doc = $(doc);
	var content = [];
	$('.table:contains(目录) tr',doc).each(function(){
		if($(this).hasClass('tablehead')){
			return;
		}
		content.push(parser($(this)));
	});
	return content;
};

var q = async.queue(function (msg, callback) {
	var url = msg.url;
	$.ajax(url).done(function(doc){
		var data = parsePage(doc);
		callback(null, msg.p, data);
	}).fail(function(){
		callback('request failed.');
	});
}, 5);

var rows = [];
q.drain = function(){
	var csv = parsePage('body');
	for(var i=0;i<rows.length;i++){
		csv = csv.concat(rows[i]);
	}
	setDownloadURL(csv).addClass('active');
}

/* 开始导出 */
var doExport = function(e){
	e.preventDefault();
	var hasPages = function(){
		return $('.page a').length>0;
	};
	dialog.show();
	var lastPage = $('.page a:last').text();
	if(hasPages())
		$('#p-last').html(lastPage);
	else
		$('#p-last').html(1);
	if(!hasPages()){
		q.drain();
	}
	$('.page a').each(function(i){
		var href = $(this).attr('href');
		if(href){
			q.push({p:i, url: href},function(err, i, data){
				if(!err){
					rows[i] = data;
					$('#p-total').html(rows.length);
				}
			});
		}
	});
};
//Add export button
(function($, handler){
	var btn = $('<input class="btn02" style="margin-left:5px;" type="submit" value="导出CSV">');
	btn.click(handler);
	$('form[name=query_form] input[type=submit]').after(btn);
})(jQuery, doExport);


